import React, { Component, Fragment } from "react"
import { Button, Modal } from 'react-bootstrap'

export default class UserItem extends Component {

    constructor(props) {
        super(props)
        this.state = {
            name: props.data.name,
            phone: props.data.phone,
            isEdit: false,
            showHide: false
        }
    }

    handleInputChange = (event) => {
        const target = event.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        const name = target.name;
        const phone = target.phone
        this.setState({
            [name]: value,
            [phone]: value
        });
    }

    handleEdit = () => {
        this.setState({
            isEdit: true
        });
    }

    handleCancel = () => {
        this.setState({
            name: this.props.data.name,
            phone: this.props.data.phone,
            isEdit: false
        });
    }

    saveEdit = () => {
        this.props.update(this.state.name, this.state.phone)
        this.setState({
            isEdit: false
        });
    }

    handleModalShowHide() {
        this.setState({
            showHide: true
        })
    }

    cancelHandleModalShowHide() {
        this.setState({
            showHide: false
        })
    }

    render() {
        return (
            <Fragment>
                <tr>
                    <td>{this.props.no}</td>
                    <td>
                        {this.state.isEdit ?
                            <input
                                type="teks"
                                name="name"
                                value={this.state.name}
                                onChange={this.handleInputChange}
                                className="form-control"
                            />
                            :
                            this.state.name
                        }
                    </td>

                    <td>
                        {this.state.isEdit ?
                            <input
                                type="teks"
                                name="phone"
                                value={this.state.phone}
                                onChange={this.handleInputChange}
                                className="form-control"
                            />
                            :
                            this.state.phone
                        }
                    </td>

                    {this.props.data.sent ?
                        this.state.isEdit ?
                            <td>
                                <button type="button"
                                    className="btn btn-primary"
                                    onClick={this.saveEdit}>
                                    <i className="bi bi-download"></i>
                                    &nbsp;
                                    save
                                </button>
                                &nbsp;
                                <button type="button"
                                    className="btn btn-warning"
                                    onClick={this.handleCancel}
                                    style={{ color: "white" }}>
                                    <i className="bi bi-x-lg"></i>
                                    &nbsp;
                                    cancel
                                </button>
                            </td>
                            :
                            <td>
                                <button type="button"
                                    className="btn btn-success"
                                    onClick={this.handleEdit}>
                                    <i className="bi bi-pencil"></i>
                                    &nbsp;
                                    edit
                                </button>
                                &nbsp;
                                <button type="button"
                                    className="btn btn-danger"
                                    onClick={() => this.handleModalShowHide()}>
                                    <i className="bi bi-trash"></i>
                                    &nbsp;
                                    delete
                                </button>
                            </td>
                        :
                        <td>
                            <button type="button"
                                className="btn btn-warning"
                                onClick={this.props.resend}
                                style={{ color: "white" }}>
                                    <i className="bi bi-x-lg"></i>
                                resend
                            </button>
                        </td>
                    }
                </tr>

                <Modal show={this.state.showHide}>
                    <Modal.Header >
                        <Modal.Title>Deleted Confirmation</Modal.Title>
                    </Modal.Header>
                    <Modal.Body>Are you sure, you want delete it</Modal.Body>
                    <Modal.Footer>
                        <Button variant="secondary" onClick={() => this.cancelHandleModalShowHide()}>
                            No
                        </Button>
                        <Button variant="primary" onClick={this.props.remove}>
                            Yes
                        </Button>
                    </Modal.Footer>
                </Modal>

            </Fragment>
        )
    }
}
